import styles from './NewProduct.module.css'

function NewProduct() {


    
    return(
        <div className={styles.newproduct}>
            <h1>Add a new product</h1>
            <hr/>
            <div className={styles.row}>
                <img src={image}/>
            </div>
        </div>
    );
}

export default NewProduct;
